import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 28, height: 28, viewBox: "0 0 28 28", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M12.36 4.86A1.63 1.63 0 0115 6.13v4.57l7.36-5.84A1.63 1.63 0 0125 6.13v15.74a1.63 1.63 0 01-2.64 1.27L15 17.31v4.56a1.63 1.63 0 01-2.64 1.27L2.73 15.5a1.92 1.92 0 010-3l9.63-7.64z", fill: primaryFill }));
};
const Rewind28Filled = wrapIcon(rawSvg({}), 'Rewind28Filled');
export default Rewind28Filled;
